import React from 'react';
import style from './CreateBoard.module.css';


function CreateBoard(){

    return (
        <div className={style.CreateBoard}>
            <h1>CreateBoard</h1>
            <form>
            <label>
                Enter a name of your board:
                <input id="name" type="text" name="name" />
            </label>
            <label>
                Add your team members:
                <input id="team" type="text" name="name" />
            </label>
            <label>
                Enter the type of your board:
                <input id="type" type="text" name="name" />
            </label>
            <button id="CreateBoard" type="submit">create</button>
            </form>
        </div>
    );
}

export default CreateBoard;
